<html ng-app="ContactModule">
<head>
	<title>NG Performance</title>
	<script src="scripts/jquery_2.0.3.js"></script>
	<script src="scripts/ng_v1.0.8.js"></script>
</head>
<body>
	<div id="loading" >
		Running Test...
	</div>
	<div id="results" >

			<tr><td>Total number of milliseconds: </td><td id="timeResult"></td></tr>
		</table>
	</div>
	<div ng-controller="ContactController">
		<div ng-repeat="contact in contacts">
			<hr/>
			<div>{{ contact.name }}</div>
			<div>{{ contact.department }}</div>
		</div>
	</div>
